	beq	$t0, 0x64, key_d						# ASCII code of 'd' is 0x64
	beq	$t0, 0x70, key_p
	
	j main_loop						# ASCII code of 'p' is 0x70

	# go left
	key_a:
		div	$s7, $t1
		mfhi	$t9						
		beq	$t9, $zero, keypress_done
		jal clear_character
		jal move_left				

		b keypress_done
	# go up
	key_w:
		blt	$s7, $t2, keypress_done	
		jal clear_character									
		jal move_up			
		b keypress_done

	# go right
	key_d:
		div	$s7, $t1						
		mfhi	$t9							
		addi	$t1, $t1, -48						
		beq	$t9, $t1, keypress_done					
		jal clear_character		
		jal move_right			
		b keypress_done
		
	key_p:
		# restart game
		jal draw_start
		b keypress_done

	keypress_done:
		j main_loop						
		
	
move_right: 
	add $s7, $s7, 4
	li $t0, BASE_ADDRESS
	
	add $a2, $s7, $t0
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	jal character
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

move_left: 
	add $s7, $s7, -4
	li $t0, BASE_ADDRESS
	
	add $a2, $s0, $t0
	addi $sp, $sp, -4
	sw $ra, 0($sp)	
	
	jal character

	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
move_up: 
	
	add $s7, $s7, -2048
	li $v0, 32    # load 32 into register $v0 to trigger the sleep system call
	li $a0, 200  # load the number of milliseconds to sleep into register $a0
	syscall
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	jal character
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	li $t0, BASE_ADDRESS
	add $a2, $s7, $t0

	addi $sp, $sp, -4
	sw $ra, 0($sp)
	li $v0, 32    # load 32 into register $v0 to trigger the sleep system call
	li $a0, 100  # load the number of milliseconds to sleep into register $a0
	syscall
	jal character
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

check_grounded:   
    addi $t0, $s7, 0xA00
    lw $t2 0($t0)
    beq $t2, DARK_BLUE, stop
    addi $t0, $s7, 0xA28
    lw $t2 0($t0)
    beq $t2, DARK_BLUE, stop
    lw $t2 0($t0)

check_enemy:
    addi $t0, $s7, 0xA00
    lw $t2 0($t0)
    beq $t2, RED, stop
    addi $t0, $s7, 0xA28
    lw $t2 0($t0)
    beq $t2, RED, stop
    lw $t2 0($t0)
    j continue
continue:
    j gravity
    
gravity:
	addi	$sp, $sp, -4
	sw	$ra, 0($sp)
	jal clear_character
	add $s7, $s7, 256
	jal character
    	jal draw_platforms
	li $v0, 32    # load 32 into register $v0 to trigger the sleep system call
	li $a0, 50  # load the number of milliseconds to sleep into register $a0
	syscall
	jal check_grounded   # Check if the character is grounded
    	beq $v0, $zero, stop # If not grounded, apply gravity
	lw $ra, 0($sp)
	addi $sp, $sp, 4

