################################################################################
draw_platforms:		
                        la $t3, platforms		# store address of platform locations in $t3
			li $t8, NUM_PLATFORMS		# store number of platforms in $t8
			addi    $sp, $sp, -4
                        sw    $ra, 0($sp)
                        add $t9, $zero, $zero		# set $t9 as counter to 0
			
draw_platforms_loop:	
                        bge $t9, $t8, draw_platforms_end # if counter >= num platforms, exit the loop
			add $s0, $zero, $zero		# x counter in $s0
			add $s1, $zero, $zero		# y counter in $s1
			li $s2, PLATFORM_WIDTH
			li $s3, PLATFORM_HEIGHT
			
draw_nested_loop:	bge $s1, $s3, exit_nested_loop
			bge $s0, $s2, reset_x
			j draw_platform
			
reset_x:		add $s0, $zero, $zero		# if x >= platform width, reset to 0
			addi $s1, $s1, 1		# increment y by 1
			j draw_nested_loop
			
draw_platform:		li $t0, BASE_ADDRESS		# store base address in $t0
			lw $t1, 0($t3)			# store x in $t1
			lw $t2, 4($t3)			# store y in $t2
			add $t1, $s0, $t1		# actual x is location + x counter
			add $t2, $t2, $s1		# actual y is location + y counter
			
			sll $t1, $t1, 2			# $t1 = $t1 * 4
			sll $t2, $t2, 8			# $t2 = $t2 * 256
			add $t0, $t0, $t1		# $t0 = $t0 + $t1
			add $t0, $t0, $t2		# $t0 = $t0 + $t2, now stores address of unit

			li $s5, DARK_BLUE

			sw $s5, 0($t0)			# store brown color
			addi $s0, $s0, 1		# if x < platform width, increment x
			j draw_nested_loop
			
exit_nested_loop:	addi $t9, $t9, 1		# increment counter by 1
			addi $t3, $t3, 8		# increment address of platform
			j draw_platforms_loop
				
draw_platforms_end:	lw $ra, 0($sp)
                        addi $sp, $sp, 4
                        jr $ra	
  
