draw_start: 
            li $t0, BASE_ADDRESS        # $t0 stores base address
            la $t1, start_screen        # $t1 stores address of game_over
            li $t2, 0            # $t2 stores counter
            li $t3, NUM_UNITS        # $t3 stores total units

loop_start:
            bge $t2, $t3, exit_start
            sll $t4, $t2, 2            # calculate offset
            add $t5, $t1, $t4        # $t5 stores address of color for current unit
            lw $t5, 0($t5)            # $t5 stores color of current unit
            add $t4, $t4, $t0        # $t4 stores address of current unit
            sw $t5, 0($t4)            # paint unit black
            addi $t2, $t2, 1        # increment counter
            j loop_start
            jr $ra

exit_start:        j user_input


user_input:
   
    #li $t5, 0xffff0000         #$t5 holds the keyboard status register
    #li $t1, 0xffff0004
    
    li $s4,0xffff0000
    lw $t8,0($s4)
    beq $t8,1,press_s
    j draw_start
    
    
press_s:
    lw $t5,4($s4)

    li $v0, 32 
    li $a0, 60  # Wait one second (1000 milliseconds) 
    syscall
    lw $t5,4($s4)
    beq $t5,115, start
  
    j draw_start
	

